import React from "react";
import Header from "./components/Header";
import Home from "./components/Home";
import "./index.css";
import { Routes, Route } from "react-router";

function App() {
  return (
    <>
      <Header />
      <Routes>
        <Home />
      </Routes>
    </>
  );
}

export default App;
